# Class which can have attributes set
class expando(object):
    pass

#class for master problem
class MasterProblem:
    def __init__(self,epsilon=1e-6,delta=1e-4,IterLimit=400,Exit=0):        
        self.data = expando()        
        self.variables = expando()
        self.constraints = expando()
        self.results = expando()
#        self._init_benders_params(epsilon,delta,IterLimit,Exit)
        self._load_data()            
        self._build_model()
                         
                   
    def _load_data(self):
        Data_Load._load_network(self)     
        Data_Load._load_generator_data(self)
        Data_Load._load_wind_data(self)
        Data_Load._load_intial_data(self)
        
    def _build_model(self):
        self.model = gb.Model()        
        self.model.setParam('OutputFlag',1)
        Lib_Variables_noB.build_variables_DA(self)
        Lib_Constraints_noB.build_masterpb_constr(self)
        #Build_constraints._build_constraints_DA(self)   
        Lib_ObjFnct_noB.build_objective_masterpb(self)             

